import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  let today = new Date();
  console.log(`Current time is ${today.getUTCHours()}:${today.getUTCMinutes()}, ${today.getUTC}`);
  let easternHours = today.getUTCHours()-4
  easternHours < 0 ? easternHours += 24 : easternHours;
  console.log(easternHours);
  let currentTimeEastern;
  if (easternHours > 12) {
    currentTimeEastern = `Current Eastern time ${easternHours-12}:${today.getUTCMinutes()} PM`;
  } else {
    currentTimeEastern = `Current Eastern time ${easternHours}:${today.getUTCMinutes()} AM`;
  }
  console.log(currentTimeEastern);

  let centralHours = today.getUTCHours()-5;
  let currentTimeCentral;
  if (centralHours > 12) {
    currentTimeCentral = `Current Central time ${centralHours-12}:${today.getUTCMinutes()} PM`;
  } else {
    currentTimeCentral = `Current Central time ${centralHours}:${today.getUTCMinutes()} AM`;
  }
  console.log(currentTimeCentral);

  let pacficHours = today.getUTCHours()-7;
  let currentTimePacific;
  if (pacficHours > 12) {
    currentTimePacific = `Current Pacific time ${pacficHours-12}:${today.getUTCMinutes()} PM`;
  } else {
    currentTimePacific = `Current Pacific time ${pacficHours}:${today.getUTCMinutes()} AM`;
  }
  console.log(currentTimePacific);


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Current time is {easternHours}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
